VALUES ('3345100009056', 'Sandwich roti creme fraiche', 'Pain blanc (55%) : farines (blé* , blé malté*), huiles végétales partiellement hydrogénées, sucre gluten de blé, sel, levure, lécithine de soja conservateur E282, arôme. Rôti de porc cuit (33%) : longe de porc (83%), eau, dextrose de blé, sirop de glucose, sel, condiments, stabilisant E451i exhausteur de goût : E621, extrait d\'épices, arôme antioxydants : E316. soja\'. Sauce creme fraiche (12%) crème* conservateurs : E270, E330, E334. épices. Contient ; blé. soja. lait', 'https://static.openfoodfacts.org/images/products/334/510/000/9056/front_fr.4.400.jpg', '8.4', '4.2', '27.6', '0.4', '', '10.6', '2.9', '1.14173228346457', '', '0');

